import Blog from './blog/Blog'
import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";


function App() {
  return (
    <BrowserRouter>
    <Routes>

    <Route index element={<Blog/>}/>

    </Routes>
  </BrowserRouter>
  );
}

export default App;
